(1, 1, '2013-01-06 09:31:49', '2013-01-06 09:31:49', 'Welcome to WordPress. This is your first post. Edit or delete it, then start blogging!', 'Hello world!', '', 'trash', 'open', 'open', '', 'hello-world', '', '', '2013-01-06 10:34:37', '2013-01-06 10:34:37', '', 0, 'http://boxngo.local/app/webroot/blog/?p=1', 0, 'post', '', 1),
(11, 1, '2013-01-06 09:31:49', '2013-01-06 09:31:49', 'This is an example page. It''s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I''m a bike messenger by day, aspiring actor by night, and this is my blog. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin'' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href="http://boxngo.local/app/webroot/blog/wp-admin/">your dashboard</a> to delete this page and create new pages for your content. Have fun!', 'Sample Page', '', 'publish', 'open', 'open', '', 'sample-page', '', '', '2013-01-06 09:31:49', '2013-01-06 09:31:49', '', 0, 'http://boxngo.local/app/webroot/blog/?page_id=2', 0, 'page', '', 0),
